import React, {useState} from "react";
import './TrackList.css';

const TrackList = (props) => {
    const [tracks, setTracks] = useState(props.tracks);

    return (
        <div class="TrackList">
            {/* {tracks !== undefined ? <h1>{tracks[0]}</h1> : ''} */}
            <h1>{tracks[0].name}</h1>
        </div>
    )
}

export { TrackList };
